      console.log(selectedCat);
      var cat = [];
      if($('#event_location option:selected').val()) {
        cat = [$('#event_location option:selected').val()];
      }
      if(selectedCat == 'All') {
        shuffleInstance.filter(cat);
      }
      else {
        cat.push(selectedCat);
        shuffleInstance.filter(cat);
      }

